  try { 
    await mongoose.connect('mongodb+srv://MariyaKardash:Mariya22@cluster0.pozfc.mongodb.net/store', {
      useNewUrlParser: true,
      useUnifiedTopology: true,
      useCreateIndex: true,
    }).then (() => {
      console.log('Связь с бд прошла успешно!')
    });
    app.listen(5000, () => {
      console.log('Сервер запущен...');
    });
  } catch(error) {
    console.log(error);
  }
}

start();

